import HeadNavbar from "../../components/Navbar";
import React,{Component} from "react";

import "./Home.css";

class Home extends Component{

    render() {

        return (
            <div className="Home">
                <HeadNavbar></HeadNavbar>
                <header className="App-header">
                    <h1>BuzzLink - Book an artist</h1>
                </header>

            </div>
        );
    }
}


export default Home;
